import {Component, OnInit} from '@angular/core';
import {Router} from "@angular/router";
import {FormControl, FormGroup} from "@angular/forms";

import {ChildrenService} from "../../../services/children/children.service";
import {IChild} from "../../../shared/models/IChild";
import {IGroupDto} from "../../../shared/models/IGroup";
import {IParentDto} from "../../../shared/models/IParent";

@Component({
  selector: 'app-children-list',
  templateUrl: './children-list.component.html',
  styleUrls: ['./children-list.component.scss']
})
export class ChildrenListComponent implements OnInit {
  childrenList: IChild[] = [];
  message: string = '';
  searchForm = new FormGroup({
    search: new FormControl('')
  });

   constructor(
    private _childrenService: ChildrenService,
    private _router: Router
  ) { }

  ngOnInit() {
    this.refreshChildrenList();
  }

  refreshChildrenList() {
    this._childrenService.getAll().subscribe(
      response => {
        this.childrenList = response;
      }
    )
  }

  deleteChild(id?: number) {
    this._childrenService.deleteChild( id).subscribe(
      response => {
        this.message = `Delete of Child ${id} Successful!`;
        this.refreshChildrenList();
      }
    )
  }

  updateChild(id?: number) {
    this._router.navigate(['admin/children', id])
  }

  addChild() {
     let group: IGroupDto = {
       id: 1, name: "Fluturasii"
     }
     let parent: IParentDto = {
       firstName: "parent", lastName: "parent", phoneNumber: "071231231212"
     }
     let child: IChild = {
       picture: "",
       dateOfBirth: new Date(), cnp: "a2", firstName: "a", group: group, lastName: "a", parent: parent

     }
    this._childrenService.addChild(child).subscribe(
      response => {
        console.log(response)
      }
    );

  }

  handleViewChild(child: IChild) {
    this._router.navigate(['admin/children', child.cnp])
  }
}
